import { Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
function History() {
  return (
    <Container>
      <Col className="border border-dark" xs={8} md={8}>
        <h1> Music History</h1>
        <p>Random Text</p>
      </Col>
    </Container>
  );
}

export default History;
